import './App.css';
import LoginPage from './LoginPage';
import SignupPage from './SignupPage';
import { BrowserRouter, Switch, Route } from "react-router-dom";


function App() {
  return (
    <BrowserRouter>
      <Switch>
      <Route path="/login">
          <LoginPage />
        </Route>
        <Route path="/signup">
          <SignupPage />
        </Route>
        // your other routes go here
      </Switch>
    </BrowserRouter>

  );
}

export default App;
